import { 
      MeshReflectorMaterial, 
      boxGeometry, 
      Box,
      Cylinder,
      meshStandardMaterial 
    } from '@react-three/drei';

const CupWrapper = () => {
  const size = [6, 4, 10];
  const [tR, bR, h] = size;



  return (
    <>
      <Cylinder 
        args={[tR, bR, h, 50, 50, false, 0, 2*Math.PI]} 
        visible={true}
      >
        <meshStandardMaterial 
          color={'yellow'}
          transparent
          opacity={0.9}
        />
      </Cylinder>
      <Cylinder 
        args={[tR, bR, h, 50, 50, true, 0, 1*Math.PI]} 
        visible={true}
      >
        <meshStandardMaterial 
          color={'blue'}
          transparent
          opacity={0.9}
        />
      </Cylinder>
      <Cylinder 
        args={[tR, bR, h, 50, 50, true, 2*Math.PI, 1*Math.PI]} 
        visible={true}
      >
        <meshStandardMaterial 
          color={'red'}
          transparent
          opacity={0.5}
        />
      </Cylinder>
      <Cylinder 
        args={[tR, bR, h, 50, 50, true, 0, 1*Math.PI]} 
        visible={true}
      >
        <meshStandardMaterial 
          color={'green'}
          transparent
          opacity={0.5}
        />
      </Cylinder>
    </>
  );
};

export default CupWrapper;
